import React from 'react'
import "../sidebar/Sidebar.css";


const Sidebar = () => {
  const menuItem=[
    {
      path:"/",
      name:"Kompyuter və noutbuklar"
    },
    {
      path:"/",
      name:"Telefonlar"
    },
    {
      path:"/",
      name:"Məişət texnikası"
    }
  
  ]
  return (
    <div className='sidebar' >
       <ul>
        <li>Məişət texnikası</li>
        <li>Kişilər üçün geyimlər</li>
        <li>Qadınlar üçün geyimlər</li>
        <li>Uşaqlar üçün geyimlər</li>
        <li>Avtomobil məhsulları</li>
        <li>Gözəllik və təravət</li>
        <li>İdman və əyləncə</li>
        <li>Ev heyvanları üçün mallar</li>
        <li>Hobbi və yaradıcılıq</li>
        <li>Dəftərxana ləvazimatları</li>
        <li>Məişət kimyası</li>
        <li>Hamam məhsulları</li>
        <li>Yataq otağı məhsulları</li>
        <li>Aksesuarlar</li>
       </ul>
    </div>
  )
}

export default Sidebar
